import React from "react";
import PropTypes from "prop-types";

const Header = props => {
  return <h1 sytle={{ color: "red", fontSize: "50px" }}>{props.branding}</h1>;
};

Header.defaultProps = {
  branding: "My App"
};

Header.proptTypes = {
  branding: PropTypes.string.isRequired
};

export default Header;
